import Link from "next/link";

const Navbar = () => {
  return (
    <div>
      <ul>
        <li>
          <Link href="/">
            <a>Live Prices</a>
          </Link>
        </li>
        <li>
          <Link href="/nes">
            <a>News</a>
          </Link>
        </li>
        <li>
          <Link href="/">
            <a>Portfolio</a>
          </Link>
        </li>
      </ul>
    </div>
  );
};

export default Navbar;
